insert  into `information`(`id`,`title`,`content`,`date`,`userid`) values (8,'云南鲁甸地震首日聚焦','\r\n              		<span>\r\n              		<span>\r\n              		<span>\r\n              		<span>\r\n              		<span>\r\n              		<span>\r\n              		<span><p><b>新华网北京８月３日</b>电(新华社“新华视点”记者)一场灾难突如其来。北京时间８月３日１６时３０分许，云南省昭通市鲁甸县境内发生６．５级地震，造成重大人员伤亡。截至４日２时，地震已造成云南昭通、曲靖两市３６７人死亡、１８８１人受伤。</p>\r\n		         <p>震情牵动着中南海。地震发生后，习近平总书记作出重要指示：当前把救人放在第一位，努力减少人员伤亡，妥善做好群众安置工作。李克强总理批示要求，千方百计抢救被掩埋和受伤人员。</p>\r\n		         <p>灾情就是号令。当地党政军和中央各部门迅速响应，多支抢险救援队紧急驰援。</p>\r\n		         <p><strong>人员伤亡　道路中断　云南遭遇１４年来最大地震</strong></p>\r\n		         <p>“来得太突然了！”震区一名群众告诉记者，地震发生时，他在５楼的家中感到强烈震动，家中一些小件物品掉落。随后大多数人都跑到街道上躲避，家里断了电。</p>\r\n		         <p>这是云南省１４年来最大的一次地震。</p>\r\n		         <p>灾难发生地鲁甸县属于人口稠密地区，而当地农村房屋却以砖混和土木结构为主，部分房屋抗震能力差。</p>\r\n		         <p>据鲁甸县城一名群众介绍，街道上随处可见有人接电话在哭，说亲人被埋或房屋倒塌。鲁甸县县长告诉记者，目前龙头山镇和火德红乡两个乡镇灾情较重，龙头山镇大量房屋严重开裂倒塌，居民家的电全灭了。</p>\r\n		         <p>龙头山镇镇长陈国勇在电话中告诉记者，镇里受灾情况非常严重，有太多房屋受损。截至３日２０时左右，全镇已有４０多人死亡，数十人受伤。由于通往村组的道路受阻、通讯不畅，灾情统计进展艰难。</p>\r\n		         <p>在龙头山镇龙泉村，记者看到村民周敏正抬着自己的侄子往外转运。他告诉记者，他侄子家的房子全塌了，侄子家的老人已经遇难，侄子受伤昏迷。</p>\r\n		         <p>连日降雨还导致鲁甸县城通往震中龙头山镇的道路因塌方中断，救援队伍只能靠人扛的方式将物资运入灾区。</p>\r\n		         <p>赶赴龙头山镇的一名大学生志愿者反映：“路况十分糟糕，两公里不到的一段路就有七八处被大石头阻断，随时还有石头滚落。”</p>\r\n		         <p>地震对鲁甸的通讯也造成很大影响。</p></span>\r\n              </span>\r\n              </span>\r\n              </span>\r\n              </span>\r\n              </span>\r\n              </span>\r\n              ','2014-08-31 23:51:58',2),(15,'火影忍者','火影忍者','2014-08-06 22:56:54',2),(24,'周五下午2点开会','请务必到场','2014-08-08 12:55:38',2),(25,'zhuti',', zhengwen\r\n               \r\n              ','2014-08-18 09:40:39',2),(26,'lalalalal',', <font size=\"5\"><b>lalallalalal</b></font>\r\n               \r\n              ','2014-08-18 09:44:07',2),(27,'adfasdf',', ','2014-08-18 09:46:15',2),(28,'这是一个测试',', <blockquote><div align=\"justify\"><div><div><div><div><div><div><div><div><div><div><div><div><u><i><b>测绘</b></i><b>的沙发的说法</b></u><br></div></div></div></div></div></div></div></div></div></div></div></div></div></blockquote>\r\n               \r\n              ','2014-08-19 10:22:11',2),(29,'测试首页',', <blockquote><div align=\"justify\">啦啦啦啦啦<br></div></blockquote>\r\n               \r\n              ','2014-08-19 20:48:58',2),(30,'啦啦啦啦',', <blockquote><div align=\"justify\">啦啦啦啦<br></div></blockquote>\r\n               \r\n              ','2014-08-19 20:51:47',2),(31,'aaa',', \r\n               \r\n              ','2014-08-22 13:58:57',2),(32,'ss','','2014-09-04 15:17:08',2),(33,'dfsasdfasdf','asdsadasdas<span></span>','2014-09-04 15:18:32',2),(34,'dasd','fdsfsdfds','2014-09-04 15:19:46',2),(35,'fsdf',', sfsfsf','2014-09-04 15:19:50',2),(36,'test1',', &lt;script&gt;alert(\"1\");&lt;/script&gt;<div>sdasd</div>','2014-09-04 15:20:42',2),(37,'test2',', dasdsadasdsa','2014-09-04 15:20:57',2);

