insert  into `paper`(`id`,`name`,`theme`,`summary`,`magazineName`,`publishTime`,`description`,`programId`,`fileId`,`type`,`qi`,`juan`,`pagination`,`SCIIndex`,`EIIndex`,`homeImportantArticle`,`homeCoreArtile`,`SCIQuote`,`EIQuote`,`state`) values (12,'IPv6网络中蠕虫传播模型及分析 ','IPv6 ;网络蠕虫;蠕虫扫描策略;蠕虫传播模型;蠕虫防御策略 ','IPv6 网络由于其巨大的地址空间,通常被认为对随机扫描蠕虫有天然的抵御能力,该文研究了一种可以在IPv6 网络中迅速传播的新型网络蠕虫 . 基于对V62Worm 扫描策略的分析,分别建立简单传染病模型和双因素蠕虫模型来仿真V62Worm 的传播趋势. 简单传染病模型的仿真结果证明,V62Worm 拥有比随机扫描蠕虫更快的传播速度;双因素蠕虫模型的仿真结果证明,V62Worm 拥有更强的对抗蠕虫控制措施的能力,同时在研究中发现主机中存在漏洞的比例是V62Worm 传播性能的主要影响因素. 最后,文中从防止地址信息泄漏和降低主机存在漏洞比例两个角度,讨论了V62Worm 的防御策略. ','计算机学报 ','2006 ','网络安全 ',NULL,NULL,NULL,8,29,'1337-1345 ',NULL,'064110165626 ',1,1,5,5,'已发表'),(13,'lalala','lalala','                  	lalallalal\r\n                  ','science','2014','eeee',NULL,NULL,'国际期刊',0,0,'110-119','1111111111','1111111111',0,0,2,1,'审核中'),(14,'11111111111122','111122','                  	\r\n                  ','111111111111122','11111111122','1111111111122',4,NULL,'国际会议',0,2,'111-12122','111111122','11111111111122',1,1,11122,11122,'已发表'),(15,'12222','121','78897912122222222222222222\r\n                  \r\n                  ','1212121','1212','12',NULL,NULL,'国际期刊',0,0,'1212','1212','1212',0,0,12,12,'已发表'),(16,'测试','1212','                  	                  	                  	                  	                  	                  	                  	12122222222222222\r\n                  \r\n                  \r\n\r\n                  \r\n                  \r\n                  ','测试','2015','12',NULL,NULL,'国际期刊',0,0,'111-121','1212','1212',0,0,12,12,'已发表');

